import React, { useState } from 'react';
import { useHistory } from 'react-router-dom'; // Use useHistory for navigation
import PropTypes from 'prop-types';

import './features1.css';

const Features1 = (props) => {
  const [activeTab, setActiveTab] = useState(0);
  const history = useHistory(); // Initialize useHistory for navigation

  return (
    <div className="thq-section-padding">
      <div className="features1-container2 thq-section-max-width">
        <div className="features1-image-container">
          {activeTab === 0 && (
            <img alt={props.feature1ImgAlt} src={props.feature1ImgSrc} className="features1-image1 thq-img-ratio-16-9" />
          )}
          {activeTab === 1 && (
            <img alt={props.feature2ImgAlt} src={props.feature2ImgSrc} className="features1-image2 thq-img-ratio-16-9" />
          )}
          {activeTab === 2 && (
            <img alt={props.feature3ImgAlt} src={props.feature3ImgSrc} className="features1-image3 thq-img-ratio-16-9" />
          )}
        </div>
        <div className="features1-tabs-menu">
          <div onClick={() => setActiveTab(0)} className="features1-tab-horizontal1">
            <div className="features1-divider-container1">
              {activeTab === 0 && <div className="features1-container3"></div>}
            </div>
            <div className="features1-content1">
              <h2 className="thq-heading-2">{props.feature1Title}</h2>
              <span className="thq-body-small">{props.feature1Description}</span>
            </div>
          </div>
          <div onClick={() => setActiveTab(1)} className="features1-tab-horizontal2">
            <div className="features1-divider-container2">
              {activeTab === 1 && <div className="features1-container4"></div>}
            </div>
            <div className="features1-content2">
              <h2 className="thq-heading-2">{props.feature2Title}</h2>
              <span className="thq-body-small">{props.feature2Description}</span>
            </div>
          </div>
          <div onClick={() => setActiveTab(2)} className="features1-tab-horizontal3">
            <div className="features1-divider-container3">
              {activeTab === 2 && <div className="features1-container5"></div>}
            </div>
            <div className="features1-content3">
              <h2 className="thq-heading-2">{props.feature3Title}</h2>
              <span className="thq-body-small">{props.feature3Description}</span>
            </div>
          </div>
        </div>

        {/* Add Login Button */}
        <div className="features1-login-container">
          <button onClick={() => history.push('/login')} className="features1-login-button">
            Go to Login
          </button>
        </div>

      </div>
    </div>
  );
};

Features1.defaultProps = {
  feature1ImgAlt: 'Therapist providing counseling to a client',
  feature3Description: 'Guidance and mediation for families to improve communication, resolve conflicts, and strengthen relationships',
  feature3Title: 'Family Therapy',
  feature3ImgSrc: 'https://images.unsplash.com/photo-1515377905703-c4788e51af15?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&ixid=M3w5MTMyMXwwfDF8cmFuZG9tfHx8fHx8fHx8MTczOTM1MDY3MXw&ixlib=rb-4.0.3&q=80&w=1080',
  feature1ImgSrc: 'https://images.unsplash.com/photo-1523837157348-ffbdaccfc7de?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&ixid=M3w5MTMyMXwwfDF8cmFuZG9tfHx8fHx8fHx8MTczOTM1MDY3Mnw&ixlib=rb-4.0.3&q=80&w=1080',
  feature2Description: 'Supportive group sessions to foster connection, understanding, and growth among participants',
  feature1Title: 'Individual Therapy',
  feature3ImgAlt: 'Therapist conducting a family therapy session',
  feature1Description: 'Tailored one-on-one sessions to address personal challenges and promote emotional well-being',
  feature2ImgSrc: 'https://images.unsplash.com/photo-1585127811048-8176de140beb?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&ixid=M3w5MTMyMXwwfDF8cmFuZG9tfHx8fHx8fHx8MTczOTM1MDY3M3w&ixlib=rb-4.0.3&q=80&w=1080',
  feature2ImgAlt: 'Group therapy session with diverse participants',
  feature2Title: 'Group Therapy',
};

Features1.propTypes = {
  feature1ImgAlt: PropTypes.string,
  feature3Description: PropTypes.string,
  feature3Title: PropTypes.string,
  feature3ImgSrc: PropTypes.string,
  feature1ImgSrc: PropTypes.string,
  feature2Description: PropTypes.string,
  feature1Title: PropTypes.string,
  feature3ImgAlt: PropTypes.string,
  feature1Description: PropTypes.string,
  feature2ImgSrc: PropTypes.string,
  feature2ImgAlt: PropTypes.string,
  feature2Title: PropTypes.string,
};

export default Features1;
